import React from 'react';
import Dialog from './functional/Dialog.js';
import getKey from './utils/KeyGenerator.js';

class LogDirectory extends React.Component {

    postDirectory = (localStorage.getItem("postDirectory") === null) ? [] : JSON.parse(localStorage.getItem("postDirectory"));

    constructor(props) {
        super(props);
        this.title = props.title;
        this.message = props.message;
        this.sessionClick = this.sessionClick.bind(this);
    }
    sessionClick(item) {
        console.log(`sessionClick --> ${item}`)
    }
    items = () => this.postDirectory;
    group = (item) => item.group;
    sessions = () => this.items().map((item) => {
        return <div key={getKey("log")} className="navButton buttonPad" onClick={this.sessionClick}>
                    {item}
                </div>
    })
    logs = () => {
        this.selectorStatus = [];
        return this.sessions();
    }
    render() {
        return (
            <Dialog title="Log Directory" message="please select...">
                    {this.logs()}
            </Dialog>
        );
    };
}

export default LogDirectory;
